import styled from "styled-components";
import { colors } from "../../theme";

export const Container = styled.div`
  background-color: ${colors.background};
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  color: #ffffff;
  flex-direction: column;
  form {
    display: flex;
    flex-direction: column;
    width: 80vw;
    max-width: 500px;
    margin: 0px;
    padding: 0px;
    background-color: pink;
    padding: 20px;
    input {
      height: 70px;
    }
  }
`;
